- input: '"TEXT","F3XA","C00005173","The Democratic State Party Victory Fund is an
    ongoing direct mail joint fundraising program between the DNC and the State Democratic
    Executive Committee of Alabama. Accordingly the DNC provides memo schedules on
    a quarterly basis during a federal election year and not with each proceed transfer.  The
    memo entries in this report will be reflected in proceed transfers that will be
    disclosed on subsequent reports. There was no Federal Election Activity this reporting
    period. All transfers from the non-federal account for allocated activities will
    be timely made within the 70-day period, no more than 10 days before or 60 days
    after vendor payment. All administrative expenses (excluding salary) were paid
    from the federal account; there were no in-kind contributions."'
